import React from "react";

import
{
    Nav, 
    NavLink,
    Bars, 
    NavMenu,

} from './NavbarElements';

const Navbar = () => {
    return (
        <>
        <Nav>
            <Bars/>
            <NavMenu>
                <NavLink to="/Home">Home</NavLink>
                <NavLink to= "/Memo">Memo</NavLink>
                <NavLink to="/Games">Games</NavLink>
            </NavMenu>
        </Nav>
        </>
    );
};

export default Navbar;
